import React from "react";
import TeamMember from "./TeamMember";


function Team () {
    return(
        <div style={{ display: 'flex' }}>
        <TeamMember 
        info = {{
        name: 'Samer' 
        }} />
        
        </div>
    ) 

}
export default Team ;
